import React from "react";
import { Row, Col } from "antd";

export const Projects = () => {
  return (
    <div className="projects" id="projects">
      <div className="projects-title">Projects</div>

      <div className="grid-container">
        <div className="cards">
          <Row gutter={[24, 24]}>
            <Col span={8} /> Card1
            <Col span={8} /> Card2
            <Col span={8} /> Card3

            <Col span={8} /> Card4
            <Col span={8} /> Card5
            <Col span={8} /> Card6
          </Row>
          <Row gutter={[24, 24]}>
            <Col span={8} /> Card7
            <Col span={8} /> Card8
            <Col span={8} /> Card9
          </Row>
        </div>
      </div>
    </div>
  );
};

export default Projects;
